sp_widget.client_script:
function($scope, AGGridFactory, $timeout) {
    /* widget controller */
    var c = this;
    c.targetOrg = c.data.selectedOrg;
    c.userAuth = $rootScope.userAuth;

    var projManager = new AGGridFactory();

    c.addNew = function() {
        projManager.editRow("-1", "organization_ref=" + c.targetOrg, c.data.tableName);
    }

	c.canAdd = function() { 
		if (c.userAuth.roles.isSysAdmin || c.userAuth.roles.isOrgAdmin) {
			if (c.userAuth.orgs.indexOf(c.targetOrg) >= 0) 
				return true;
			else
				return false;
		}
		else
			return false;
	}

c.canEdit = function(auth, data) {
        if (auth.orgs.indexOf(c.targetOrg) >= 0)
            return true;
        else
            return false;
    }

    c.canDelete = function(auth, data) {
        return c.canEdit(auth, data);
    }

    c.exportExcel = function() {
        projManager.exportExcel();
    }

    projManager.setColumns([{
            field: 'edit',
            headerName: 'Edit',
            maxWidth: 50,
            cellStyle: {
                textAlign: 'center'
            },
            suppressMenu: true,
            sortable: false,
            cellRenderer: 'editCell',
            cellRendererParams: function(params) {
                return {
                    "show": c.canEdit(c.userAuth, params.data)
                };
            }
        },
        {
            field: 'project_code',
            headerName: 'Project Code',
            sort: 'asc',
					  filter: 'agTextColumnFilter',
            cellStyle: {
                color: 'blue',
                'text-decoration': 'underline',
                'cursor': 'pointer'
            }
        },
        {
            field: 'project_name',
            headerName: 'Project Name',
					  filter: 'agTextColumnFilter'
        },
        {
            field: 'omb_project_name',
            headerName: 'OMB Project Name',
					   filter: 'agTextColumnFilter'
        },
        {
            field: 'investment',
            headerName: 'Investment',
					 filter: 'agTextColumnFilter'
        },
        {
            field: 'function_code_ref',
            headerName: 'Function Code',
					  filter: 'agTextColumnFilter'
        },
        {
            field: 'project_desc',
            headerName: 'Description',
					  filter: 'agTextColumnFilter'
        },
        {
            field: 'delete',
            headerName: 'Del.',
            maxWidth: 50,
            cellStyle: {
                textAlign: 'center'
            },
            suppressMenu: true,
            sortable: false,
            cellRenderer: 'deleteCell',
            cellRendererParams: function(params) {
                return {
                    "show": c.canDelete(c.userAuth, params.data)
                };
            }
        }
    ]);

    var projectProps = {
        pageController: c,
        tableName: c.data.tableName,
        dataArray: null,
        pageType: 'Project',
        linkedField: 'project_code',
        detailsPage: 'project_detail',
        usePaging: false
    }

    projManager.setPageProperties(projectProps);
    projManager.setRenderers('project_name'); //build renderers and set display field to show on delete attempt
    projManager.renderGrid('projGrid'); //render grid objects
    projManager.setGridData(c.data.tableData); //set grid data
    projManager.setColumnsVisible(['edit', 'delete'], (c.userAuth.roles.isSysAdmin || c.userAuth.roles.isOrgAdmin));
    $timeout(function () { projManager.fitColumns(); }, 250);

    $rootScope.$on('OrgChanged', function(event, args) {
        c.server.get({
            mode: "setOrg",
            org_id: args.org_id
        }).then(function(resp) {
            c.targetOrg = resp.data.selectedOrg;
            projManager.setGridData(resp.data.tableData); //set grid data
        });

    });

}

